export default function Form() {
  function handelrSubmit(e) {
    e.preventDefault();
  }
  return (
    <>
      <form className=" text-2xl" onSubmit={(e) => handelrSubmit(e)}>
        <div >
          <label htmlFor="firstName">Your Fist Name</label>
          <input id="firstName" type="text" />
        </div>
        <div>
          <label htmlFor="listName">Your List Name</label>
          <input id="listName" type="text" />
        </div>
      </form>
    </>
  );
}
